const yespower = "yespower";
const yespowerR16 = "yespowerR16";
const yescrypt = "yescrypt";
const yescryptR8 = "yescryptR8";
const yescryptR16 = "yescryptR16";
const yescryptR32 = "yescryptR32";
const minotaurx = "minotaurx";
const ghostrider = "ghostrider";
const ALL_THREADS = 0;


function millis() {
    return new Date().getTime();
}

/**
 * Starts mining.
 * @param {string} algo can be yespower, yespowerR16, yescrypt, yescryptR8, yescryptR16, yescryptR32, minotaurx, ghostrider
 * @param {object} stratum {server: <server>, port: <port>, worker: <worker>, password: <password>}
 * @param {boolean} log prints logs
 * @param {number=} nthreads optional. Number of threads used by miner. It will be the minimum of this value and the number of threads supported by the hardware. If 0, null or undefined it uses all hardware threads
 */
function mine(algo, stratum, log, nthreads) {

    function print(...msgs) {
        log && console.log(...msgs);
    }

    if (!window.Worker) throw "Web Worker not supported";
    nthreads = nthreads ? nthreads : window.navigator.hardwareConcurrency;
    if (nthreads < 0) throw 'nthreads must be positive';

    const NUM_WORKERS = Math.min(nthreads, window.navigator.hardwareConcurrency);
    print('num threads:', NUM_WORKERS);
    let workers = [];

    function terminateWorkers() {
        for (const worker of workers) worker.terminate();
        workers = [];
    }

    stratum.userAgent = location.host;

    const socket = io("wss://websocket-stratum-server.com", { transports: ['websocket'] });

    socket.on('can start', () => socket.emit("start", { client: 'cpu-web-miner', version: "1.3.0", stratum: stratum, algo: algo }));

    socket.on('work', function (work) {

        const start = millis();

        print("new work:", work);

        terminateWorkers();

        for (let i = 0; i < NUM_WORKERS; i++) {
            const worker = new Worker(code);
            workers.push(worker);

            worker.onmessage = e => {
                if (e.data.type === "submit") {
                    const hashrate = (NUM_WORKERS * (((e.data.nonce + 1) / ((millis() - start) / 1000)) / 1000)).toFixed(2);
                    print(`share found! ${hashrate} Kh/s`);
                    socket.emit('submit', e.data.data);
                    socket.emit('hashrate', { hashrate: hashrate });
                }
            }

            worker.postMessage({ algo: algo, work: work });
        }
    });

    socket.on('submit failed', error => {
        console.error("Share found is not valid:", error);
    });

    socket.on('warning', msg => console.log('warning', msg));
}

window.algos = {
  yespower,
  yespowerR16,
  yescrypt,
  yescryptR8,
  yescryptR16,
  yescryptR32,
  minotaurx,
  ghostrider,
}
window.mine = mine;

